script: |
  super -f text -I q2246.spq | sort > q2246.out

inputs:
  - name: q2246.spq
    data: |
      SELECT e
      FROM t1 (FORMAT parquet)
      WHERE d>e
      AND d NOT BETWEEN 110 AND 150
      AND (e>c OR e<d);
  - name: t1

outputs:
  - name: q2246.out
    data: |
      162
      180
      210
      221
      230
      237
      246
